import React from "react";
import './WeatherList.css';
import WeatherDay from "./WeatherDay";
import sunny from '../Images/sunny.png';
import cloudy from '../Images/cloudy.jpeg';
import rainy from '../Images/rainy.png'


const WeatherList = () => {
    return (
        <div>
            <div className="weatherListWrapper">
                <div className="weatherListHeadingWrapper">
                    <div className="cityNameWrapper">
                        <h2>Boston</h2>
                    </div>
                    <div className="temperatureWrapper">
                        <h2>9 degree's</h2>
                    </div>
                    <div className="temperatureImage">
                        <img id="tempId" src={cloudy} alt="temperatureImage" />
                    </div>
                </div>
                <div className="weatherDays">
                    <div className="weatherDateandDay">Sun Nov 27</div>
                    <div className="weatherDegress">12 Degree's</div>
                    <div className="weatherDayImage">
                        <img id="weatherDayImage" src={sunny}  alt="weatherDayImage" />
                    </div>
                </div>
            </div>
        </div>
    );
}

export default WeatherList;
